import React, { useState } from "react";
import { Rnd } from "react-rnd";

// TextEditor Props:
// - onUpdate: callback to send all text boxes info to parent if needed
const TextEditor = ({ onUpdate }) => {
  const [textBoxes, setTextBoxes] = useState([]);
  const [newText, setNewText] = useState("");

  // Add a new text box
  const handleAddText = () => {
    if (!newText.trim()) return;
    const id = Date.now();
    setTextBoxes([
      ...textBoxes,
      {
        id,
        text: newText,
        x: 50,
        y: 50,
        fontSize: 24,
        bold: false,
        italic: false,
        underline: false,
        upper: false,
        lower: false,
      },
    ]);
    setNewText("");
  };

  // Update a specific text box
  const updateTextBox = (id, updated) => {
    setTextBoxes(textBoxes.map(tb => tb.id === id ? { ...tb, ...updated } : tb));
  };

  // Delete a text box
  const deleteTextBox = (id) => {
    setTextBoxes(textBoxes.filter(tb => tb.id !== id));
  };

  // Helper to get text style
  const getStyle = (tb) => {
    let text = tb.text;
    if (tb.upper) text = text.toUpperCase();
    if (tb.lower) text = text.toLowerCase();
    return {
      fontSize: tb.fontSize,
      fontWeight: tb.bold ? "bold" : "normal",
      fontStyle: tb.italic ? "italic" : "normal",
      textDecoration: tb.underline ? "underline" : "none",
      cursor: "move",
      padding: "4px",
      backgroundColor: "rgba(255,255,255,0.2)",
      border: "1px dashed #aaa",
      position: "absolute",
      whiteSpace: "pre",
    };
  };

  return (
    <div style={{ marginTop: "20px" }}>
      {/* Input for adding new text */}
      <input
        type="text"
        value={newText}
        onChange={(e) => setNewText(e.target.value)}
        placeholder="Enter text"
        style={{ width: "70%", padding: "5px" }}
      />
      <button onClick={handleAddText} style={{ marginLeft: "5px" }}>Add Text</button>

      {/* Render all text boxes */}
      <div style={{ position: "relative", width: "100%", height: "500px", border: "1px solid #ccc", marginTop: "10px", backgroundColor: "#f0f0f0" }}>
        {textBoxes.map(tb => (
          <Rnd
            key={tb.id}
            default={{ x: tb.x, y: tb.y, width: "auto", height: "auto" }}
            bounds="parent"
            onDragStop={(e, d) => updateTextBox(tb.id, { x: d.x, y: d.y })}
            onResizeStop={(e, direction, ref, delta, position) => {
              updateTextBox(tb.id, { fontSize: parseInt(ref.style.fontSize) || tb.fontSize, ...position });
            }}
          >
            <div style={getStyle(tb)}>
              {tb.text}
              {/* Action buttons */}
              <div style={{ marginTop: "5px" }}>
                <button onClick={() => updateTextBox(tb.id, { bold: !tb.bold })}>B</button>
                <button onClick={() => updateTextBox(tb.id, { italic: !tb.italic })}>I</button>
                <button onClick={() => updateTextBox(tb.id, { underline: !tb.underline })}>U</button>
                <button onClick={() => updateTextBox(tb.id, { upper: !tb.upper, lower: false })}>Upper</button>
                <button onClick={() => updateTextBox(tb.id, { lower: !tb.lower, upper: false })}>Lower</button>
                <button onClick={() => deleteTextBox(tb.id)} style={{ color: "red" }}>✖</button>
                <button onClick={() => onUpdate && onUpdate(tb)}>✔</button>
              </div>
            </div>
          </Rnd>
        ))}
      </div>
    </div>
  );
};

export default TextEditor;
